import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { orderApi } from '../../api/orderApi';
import Loading from '../../components/common/Loading';
import ErrorMessage from '../../components/common/ErrorMessage';
import { formatCurrency } from '../../utils/helpers';

const FarmerDashboard = () => {
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchStats();
  }, []);

  const fetchStats = async () => {
    try {
      const response = await orderApi.getFarmerStats();
      setStats(response.data);
    } catch (err) {
      setError('Failed to load dashboard statistics');
    } finally {
      setLoading(false);
    }
  };

  if (loading) return <Loading />;

  return (
    <div className="container">
      <h1>Farmer Dashboard</h1>

      <ErrorMessage message={error} onClose={() => setError('')} />

      <div className="stats-grid">
        <div className="stat-card">
          <h3>Total Products</h3>
          <p className="stat-value">{stats?.totalProducts || 0}</p>
        </div>
        <div className="stat-card">
          <h3>Active Products</h3>
          <p className="stat-value">{stats?.activeProducts || 0}</p>
        </div>
        <div className="stat-card">
          <h3>Pending Orders</h3>
          <p className="stat-value">{stats?.pendingOrders || 0}</p>
        </div>
        <div className="stat-card">
          <h3>Total Revenue</h3>
          <p className="stat-value">{formatCurrency(stats?.totalRevenue || 0)}</p>
        </div>
      </div>

      <div className="quick-actions">
        <h2>Quick Actions</h2>
        <div className="actions-grid">
          <Link to="/farmer/products/add" className="action-card">
            <span className="action-icon">âž•</span>
            <h3>Add Product</h3>
            <p>List a new product for sale</p>
          </Link>
          <Link to="/farmer/products" className="action-card">
            <span className="action-icon">ðŸ“¦</span>
            <h3>My Products</h3>
            <p>Manage your product listings</p>
          </Link>
          <Link to="/farmer/orders" className="action-card">
            <span className="action-icon">ðŸ“‹</span>
            <h3>Orders</h3>
            <p>View and manage orders</p>
          </Link>
          <Link to="/farmer/sales" className="action-card">
            <span className="action-icon">ðŸ’°</span>
            <h3>Sales History</h3>
            <p>View completed sales</p>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default FarmerDashboard;
